import { Card,Button } from "@mantine/core";
import React from "react";

function List({name,object_id}){
    return(
        <Card style={{height:'100px',width:'200px',display:'flex',position:'relative'}}>
            <table>
                <tbody>
                    <tr>
                        <td>{name}</td>
                        <td><Button onClick={()=>{console.log(object_id)}}>Delete</Button></td>
                    </tr>
                </tbody>
            </table>
        </Card>
    )
}

export default List;
